import Cards from '../Cards/Cards';
import{NavLink} from 'react-router-dom'

const HomePage = () => {
  return (
    <div>
        
        <h1>HOME PAGE:</h1>
        <h2>Aqui deben ir botones de filtro, de ordenamiento y de crear receta</h2>
        <NavLink to='/form'>
            <button> AL FORM </button>
        </NavLink>

        <Cards/>
    </div>
  )
}

export default HomePage
